import React, { Component } from "react";

class Search extends Component {
  render() {
    return (
      <div>
        <div className="ui icon input">
          <input type="text" placeholder="Search..." />
          <i
            aria-hidden="true"
            className="search circular inverted link icon"
          />
        </div>
      </div>
    );
  }
}

export default Search;
